import React from 'react'

function charInfos(messages) {
  return (
    <div>
        {messages.map(message => {
        return(
          <div key={message.id}>                                               
            <h3>{message.name}</h3>
            <h3>{message.location.name}</h3>
            <h3>{message.species}</h3>
            <img alt="img" src={message.image}/>
            
            <br></br><br></br>
          </div>
        )
      })}
    </div>
  )
}

export default charInfos
